import React from 'react'
import {
    List,
    Datagrid,
    TextField,
    EditButton,
    DeleteButton,
    UrlField,
  } from 'react-admin'
import Icon from '@material-ui/icons/Person';
import { makeStyles } from '@material-ui/core/styles';

export const VisitorIcon = Icon;

const useStyles = makeStyles({
    table: {
        backgroundColor: '#666666',
    },
    headerCell: {
        backgroundColor: '#262626',
    },
});

const PlaylistList = (props) => {
    const classes = useStyles();
    return (
        <List {...props}>
             <Datagrid classes={classes}>
                <TextField source='id' />
                <TextField source='playlist_name' />
                <TextField source='playlist_duration' />
                <UrlField target="_blank" source="playlist_image" style={{color:'orange'}}/>
                <TextField source="owner_user_id" />
                <EditButton label="View" basePath='/songs' style={{color:'#00ffff'}} />
                <DeleteButton basePath='/songs' />
            </Datagrid>
        </List>
    )
}

export default PlaylistList
